import React from "react";
import "./Hero.css";
import Design from "../Desing/Design";


const Hero = () => {
  return (
    <div className="hero">
      <Design/>
      <div className="coin-app">
        <img src="./img/per.png" alt="Profile" className="profile-image" />
        <h1>
          <span>I'm Adib Kazi,</span> a frontend developer based in Pune
        </h1>
        <p>
          I am a frontend developer from Pune, Maharashtra with 1 year of experience.
        </p>
        <div className="hero-action">
          <div className="hero-connect">Connect With Me</div>
          <div className="hero-resume">My Resume</div>
        </div>
      </div>
    </div>
  );
};

export default Hero;
